import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function SearchBar() {
  const navigate = useNavigate();
  const [searchParams, setSearchParams] = useState({
    location: '',
    minPrice: '',
    maxPrice: '',
    experience: '',
    availability: '',
    skills: '',
    rating: ''
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    const params = new URLSearchParams();
    Object.entries(searchParams).forEach(([key, value]) => {
      if (value) params.append(key, value);
    });
    navigate(`/babysitters?${params.toString()}`);
  };

  return (
    <form onSubmit={handleSubmit} className="max-w-4xl mx-auto p-4 space-y-4">
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
        <input
          type="text"
          placeholder="Location"
          value={searchParams.location}
          onChange={(e) => setSearchParams(prev => ({ ...prev, location: e.target.value }))}
          className="rounded-md border-gray-300"
        />
        <div className="flex gap-2">
          <input
            type="number"
            placeholder="Min Price"
            value={searchParams.minPrice}
            onChange={(e) => setSearchParams(prev => ({ ...prev, minPrice: e.target.value }))}
            className="rounded-md border-gray-300 w-1/2"
          />
          <input
            type="number"
            placeholder="Max Price"
            value={searchParams.maxPrice}
            onChange={(e) => setSearchParams(prev => ({ ...prev, maxPrice: e.target.value }))}
            className="rounded-md border-gray-300 w-1/2"
          />
        </div>
        <input
          type="number"
          placeholder="Min Experience (years)"
          value={searchParams.experience}
          onChange={(e) => setSearchParams(prev => ({ ...prev, experience: e.target.value }))}
          className="rounded-md border-gray-300"
        />
      </div>
      <button
        type="submit"
        className="w-full bg-primary-600 text-white py-2 rounded-md hover:bg-primary-700"
      >
        Search Babysitters
      </button>
    </form>
  );
}
